成功したインポート: {0}
保留中のインポート: {1}
失敗したインポート: {2}

Mix It Up の実行中にまだチャンネルにアクセスしていないユーザーは、データのインポートが保留されており、最初にアクセスしたときに正常にインポートされます。

インポートの失敗は、データが無効であるか、プラットフォーム上で情報が見つからないことが原因である可能性があります。必要に応じて、サポートにお問い合わせください。

成功したインポート: {0}
失敗したインポート: {1}

既存の見積もりと一致する ID を持つインポートされた見積もりは、次の最大数に変更されます。インポートの失敗は、無効なデータまたは形式が原因である可能性があります。必要に応じて、サポートにお問い合わせください。

次のサービスに接続できませんでした:

{0}

可能な場合には、サービスへの再接続を試みます。これが続く場合は、「サービス」ページに移動して手動で再接続してください。

システムを使用する;

名前空間 CustomNamespace
{
    パブリック クラス CustomClass
    {
        パブリックオブジェクト Run()
        {
            // ここにコードが入ります
            System.Console.WriteLine("Hello World!");

            // 使用したいデータをここに返します
            42 を返します。
        }
    }
}

関数 run()
{
    // ここにコードが入ります
    var text = 'Hello World!';

    // 使用したいデータをここに返します
    42 を返します。
}

var 結果 = run();
sendParentMessage({ タイプ: "ScriptComplete"、ID: "{ID}"、結果: 結果 });
